import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import { register } from '../../serviceWorker';

class Navbar extends Component{
    state = {
        isLoggedIn: false,
    }
    onClick = (e) => {
        e.preventDefault();
        let activeColor = this.props.setActivePath("/register");
        let registerElement = document.getElementsByClassName(".registerLink")
        console.log(registerElement)
        registerElement.style = {color: activeColor}
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link className="registerLink" onClick={this.onClick.bind(this)} to="/register">Register</Link></h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}
const linkStyle = {
    textDecoration: "none",
    color: "black"
}

export default Navbar;
